import React from 'react';


const WorkerList = (props) => {
    return <div>
        {
            this.props.workerData.map(function(data) {
                <h4>
                  <span>{data.name}</span>
                  {data.name}
                </h4>    
            }
            )
            }
      </div>;
}


export default WorkerList;
